import React from 'react';
import data from './categorypost.json';
import { NavLink } from 'react-router-dom';

function App() {
  const post = data.data;
  return (
    <div>
      {post.map((post) => {
        return (
          <NavLink to={`${post.slug}`}>
            <h1>{post.category}</h1>
          </NavLink>
        );
      })}
    </div>
  );
}

export default App;
